        <div class="container-fluid">
            <h1>Dashboard analytics</h1>
            <div class="row">
                <!-- div containing the heatmap -->
                <div class="col-md-6">
                    <div>
                        <form action="/cgi-bin/heatmap.py" method="get" onsubmit="return compose_datetime();">
                            <!-- <input type="text" id="datepicker" name="date"> -->
                            <input type="text" id="datepicker_heatmap">
                            <!-- <select name="hour" id="select_hour"></select> -->
                            <select id="select_hour_heatmap"></select>
                            :
                            <!-- <select name="minute" id="select_minute"></select> -->
                            <select id="select_minute_heatmap"></select>
                            <!-- <select name="minute"> -->
                            <!--     <option value="1">1</option> -->
                            <!--     <option value="2">2</option> -->
                            <!--     <option value="3">3</option> -->
                            <!--     <option value="4">4</option> -->

                            <!--     <option value="10">10</option> -->
                            <!--     <option value="11">11</option> -->
                            <!--     <option value="12">12</option> -->
                            <!-- </select> -->
                            <!-- <button type="submit" name="action" value="go">GO</button> -->
                            <button type="submit" value="go">GO</button>
                            <input type="hidden" name="datetime" id="input_datetime_heatmap">
                        </form>
                    </div>
                    <div class="heatmap-wrapper">
                        <div class="heatmap" id="map-canvas-heatmap">
                        </div>
                    </div>
                    <div>
                        <button type="button" onclick="play()" id="play_button_heatmap">Pause</button>
                        <input class="range_100" type="range" name="smp02" value="1" min="0" max="99" id="pos_play_heatmap" style="width:400px;" onclick="jump()">
                        <span id="current_date_heatmap"></span>
                    </div>
                    <!-- <div class="heatmap2"> -->
                    <!-- </div> -->
                    <div style="display:none;">
                        NaT
                    </div>
                </div>
                <!-- div containing movemap -->
                <div class="col-md-6">
                    <div>
                        <form action="./movemap.py" method="get" onsubmit="return compose_datetime();">
                            <!-- <input type="text" id="datepicker" name="date"> -->
                            <input type="text" id="datepicker_movemap">
                            <!-- <select name="hour" id="select_hour"></select> -->
                            <select id="select_hour_movemap"></select>
                            :
                            <!-- <select name="minute" id="select_minute"></select> -->
                            <select id="select_minute_movemap"></select>
                            <button type="submit" value="go">GO</button>
                            <input type="hidden" name="datetime" id="input_datetime_movemap">
                        </form>
                    </div>
                    <div class="movemap-wrapper">
                        <div class="movemap" id="map-canvas-movemap">
                        </div>
                    </div>
                    <div>
                        <button type="button" onclick="play()" id="play_button_movemap">Pause</button>
                        <input class="range_30" type="range" name="smp02" value="1" min="0" max="29" id="pos_play_movemap" style="width:400px;" onclick="jump()">
                        <span id="current_date_movemap"></span>
                    </div>
                    <div style="display:none;">
                        NaT
                    </div>
                </div>
            </div>
            <div class="row">

                    <canvas id="congestion-chart"></canvas>
